import Link from 'next/link';

const Signup = () => (
    <div>
        <ul>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/signup"><a>Signup</a></Link></li>
        </ul>
        <h1>Create an Account</h1></div>
);

export default Signup;
